import logo from './image/logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <img  style={{
            width: 300
          }} src={logo}/>
          <p></p>
        <p>
          Website đang trong quá trình xây dựng.
      Xin vui lòng quay lại sau.</p>

      </header>
    </div>
  );
}

export default App;
